import React, { Fragment } from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { useHistory } from 'react-router-dom';

import style from './Navbar.module.css';
import logo from '../../assets/images/logo.png';
import back_btn from '../../assets/images/back_btn.png';

import Menu from '../Menu';

import { setMenuOpen } from '../../actions/menuActions';

const Navbar = ({
  pageTitle,
  authorised,
  lang,
  lang_enable,
  menuOpen,
  setMenuOpen,
  backButton,
  backLink,
}) => {
  const history = useHistory();

  return (
    <Fragment>
      <div className={style.container}>
        <img className={style.logo} src={logo} alt='' />
        <div className={style.language_menu}>
          {lang_enable ? (
            <Fragment>
              <div
                className={
                  lang === 'eng'
                    ? style.eng_btn + ' ' + style.active_btn
                    : style.eng_btn
                }
              >
                Eng
              </div>
              <div
                className={
                  lang === 'ara'
                    ? style.ara_btn + ' ' + style.active_btn
                    : style.ara_btn
                }
              >
                Ara
              </div>
            </Fragment>
          ) : (
            ''
          )}
        </div>
      </div>
      <div className={style.page_title_section}>
        <h4>{pageTitle}</h4>

        {authorised ? (
          backButton ? (
            <div className={style.back_btn_icon_wrapper}>
              <img
                src={back_btn}
                alt=''
                onClick={() => history.push(backLink)}
              />
            </div>
          ) : (
            <div className={style.menu_bar_icon_wrapper}>
              <div
                className={style.menu_bar_icon}
                onClick={() => setMenuOpen(true)}
              >
                <div></div>
                <div></div>
                <div></div>
              </div>
            </div>
          )
        ) : (
          ''
        )}
      </div>
      {menuOpen ? <Menu setMenuOpen={setMenuOpen} /> : ''}
    </Fragment>
  );
};

Navbar.propTypes = {
  pageTitle: PropTypes.string,
  authorised: PropTypes.bool,
  lang: PropTypes.string,
  lang_enable: PropTypes.bool,
  menuOpen: PropTypes.bool.isRequired,
  setMenuOpen: PropTypes.func.isRequired,
  backButton: PropTypes.bool,
  backLink: PropTypes.string,
};

Navbar.defaultProps = {
  lang: 'eng',
};

const mapStateToProps = (state) => ({
  menuOpen: state.menu.opened,
});

export default connect(mapStateToProps, { setMenuOpen })(Navbar);
